import React, { useRef} from 'react';
import ReactDOM from 'react-dom';
import './index.css';


function App(){
  const sound = useRef();
  const color = useRef();

  const submit = (e) => {
    e.preventDfault();
    const soundVal = sound.current.value;
    const colorVal = color.current.value;
    alert(`${soundVal} sound like ${colorVal}`);
  }


  return(
    <form >
      <input type="text" placeholder='Sound...' />
      <input type="color" />
      <button>ADD</button>
    </form>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
